Nickolas Gene &quot;Nick&quot; Carter (born January 28, 1980) is an American singer-songwriter, dancer, musician, entertainer and actor. He is best known as a member of the pop group Backstreet Boys. He went on to release a solo album called Now Or Never during their hiatus. He has made occasional television appearances and starred in his own reality show, House of Carters. He gained fame in the late 1990s and early 2000s as a teen idol.
